package com.fashion.binge.fashiondesign.models;/** * Created by gokarna on 02/06/16. */public class ShippingProductModel {  private String productName;    private String size;    private String productId;    private String quantity;    private String price;    private String total;    private String color;    private String shippingMethod;    private String totalPrice;    private boolean isShippingBackgroundEnabled;    public boolean isShippingBackgroundEnabled() {        return isShippingBackgroundEnabled;    }    public void setShippingBackgroundEnabled(boolean shippingBackgroundEnabled) {        isShippingBackgroundEnabled = shippingBackgroundEnabled;    }    public String getTotalPrice() {        return totalPrice;    }    public void setTotalPrice(String totalPrice) {        this.totalPrice = totalPrice;    }    public String getShippingMethod() {        return shippingMethod;    }    public void setShippingMethod(String shippingMethod) {        this.shippingMethod = shippingMethod;    }    public String getColor() {        return color;    }    public void setColor(String color) {        this.color = color;    }    public String getProductName() {        return productName;    }    public void setProductName(String productName) {        this.productName = productName;    }    public String getSize() {        return size;    }    public void setSize(String size) {        this.size = size;    }    public String getProductId() {        return productId;    }    public void setProductId(String productId) {        this.productId = productId;    }    public String getQuantity() {        return quantity;    }    public void setQuantity(String quantity) {        this.quantity = quantity;    }    public String getPrice() {        return price;    }    public void setPrice(String price) {        this.price = price;    }    public String getTotal() {        return total;    }    public void setTotal(String total) {        this.total = total;    }}